import React, {Fragment} from 'react';

 const TodoApp = (props) => {
    const {titl, i, des} = props.todo;
    return (
        <Fragment>
                 <article>
                     <h2>{titl}</h2>
                     <p>{i}</p>
                     <p>{des}</p>
                 </article>
             </Fragment>
    );
};
export default TodoApp;
